function Navbar() {
    return(
        <div>
            <ul class='list-none flex flex-row justify-end space-x-3 border rounded-md'>
                <li><a href="#" class='basis-1/3'>Home</a></li>
                <li><a href="#" class='basis-1/3'>Products</a></li>
                <li><a href="#" class='basis-1/3'>Contacts</a></li>
            </ul>
        </div>
    )
}

export default Navbar;
